import React from 'react'
import { DragDropContext } from 'react-dnd'
import HTML5Backend from 'react-dnd-html5-backend'
import connect from '../../redux/connect'
import ItemBox from './itemBox'

class Features extends React.Component{
    static defaultProps={
        comps:[]
    }
    move=(x,y)=>{
        this.props.dispatch({type:'move',payload:{
            x:x,
            y:y
        }})
    }
    render(){

        const {compts}=this.props
        console.log(compts)
        return compts.map(child => {
            return <ItemBox {...child} />
        });
    }
}

const feature=DragDropContext(HTML5Backend)(Features)
export default connect(state=>state.compts)(feature)
